import Slider from './Slider';

import React, { Component } from 'react';
import '../styles/Main.css';

class Main extends Component {
  render() {

    var array = ["steph","kd","klay"];

    return (
      <div>
      <div className="header">
        <header>
        <h1> harris chowdhary </h1>
        </header>
      </div>
        <div className="body">
          <p> harris chowdhary is a multi-disciplinary artist based out of Dallas, TX </p>
        </div>
        <div className="slider">
          <Slider array={array} />
        </div>
      </div>
    );
  }
}

export default Main
